import Link from 'next/link';

const linkStyle = {
    display: 'block',
    marginRight: 15,
}
const sideBarWidth = {
    width: '30%',
}
const asideheight = {
    display: 'block',
    width: '100vh',
}

const Aside = () => {
    return (
        <div style={sideBarWidth}>
            <aside style={asideheight}>
                <Link href="/">
                    <a style={linkStyle}>Home</a>
                </Link>
                <Link href="/about">
                    <a style={linkStyle}>About</a>
                </Link>
            </aside>
            <footer>
                <div>Copyright Next App</div>
            </footer>
        </div>
    );
}

export default Aside;
